post_text:
@Turning Fear Into Love at CMS- Sept 24th

I want to extend my sincerest thanks to each and every person that participated in purchasing and passing out donuts and welcoming CMS students to school this morning. The outpouring of support in our community is overwhelming yet not surprising. THANK YOU!

Rob Roettger, Superintendent

